class DivInputRadio extends InputSingleValue{async getValue(){const t=this.input.find("input:checked");return InputFactory.getInstance(t,this.params).getValue()}async getValueGrid(){const t=this.input.find("input:checked");return InputFactory.getInstance(t,this.params).getValueGrid()}setValue(t){this.input.find(`input[value="${t}"]`).prop("checked",!0)}}